import React from 'react';
import HeaderLogo from '../../images/logo.svg';

const Header = () => {
  return(
    <header className="header">
      <div className="header__content">
          <img className="header__logo" alt="логотип сайта" src={HeaderLogo} />
      </div>
    </header>
  )
}

export default Header;
